PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `libraries` (`library_name` varchar(255) NOT NULL PRIMARY KEY, `encoding_scheme` varchar(255), `carrier` varchar(255), `produced_by` varchar(255), `date` date, `insert_length` integer, `distinct_peptides` integer, `peptide_diversity` double precision);
CREATE TABLE `selections` (`selection_name` varchar(255) NOT NULL PRIMARY KEY, `performed_by` varchar(255), `date` date, `target_id` integer REFERENCES `targets` ON DELETE SET NULL, `library_name` varchar(255) REFERENCES `libraries` ON DELETE CASCADE);
CREATE TABLE `sequencing_datasets` (`dataset_name` varchar(255) NOT NULL PRIMARY KEY, `read_type` varchar(255), `used_indices` varchar(255), `origin` varchar(255), `produced_by` varchar(255), `sequencer` varchar(255), `date` date, `selection_round` integer, `sequence_length` integer, `statistics` blob, `target_id` integer REFERENCES `targets` ON DELETE SET NULL, `library_name` varchar(255) REFERENCES `libraries` ON DELETE CASCADE, `selection_name` varchar(255) REFERENCES `selections` ON DELETE CASCADE, statistic_file varchar(255));
CREATE TABLE `peptides` (`peptide_sequence` varchar(255) NOT NULL PRIMARY KEY);
CREATE TABLE `clusters` (`cluster_id` integer NOT NULL PRIMARY KEY AUTOINCREMENT, `parameters` varchar(255), `consensus_sequence` varchar(255), `dominance_sum` double precision, `reads_sum` integer, `library_name` varchar(255) REFERENCES `libraries` ON DELETE CASCADE, `selection_name` varchar(255) REFERENCES `selections` ON DELETE CASCADE, `dataset_name` varchar(255) REFERENCES `sequencing_datasets` ON DELETE CASCADE);
CREATE TABLE `dna_sequences` (`dna_sequence` varchar(255) NOT NULL PRIMARY KEY);
CREATE TABLE `results` (`result_id` integer NOT NULL PRIMARY KEY AUTOINCREMENT, `performance` Text, `target_id` integer REFERENCES `targets` ON DELETE SET NULL);
CREATE TABLE `targets` (`target_id` integer NOT NULL PRIMARY KEY AUTOINCREMENT, `species` varchar(255), `tissue` varchar(255), `cell` varchar(255));
CREATE TABLE `clusters_peptides` (`cluster_id` integer REFERENCES `clusters` ON DELETE CASCADE, `peptide_sequence` varchar(255) REFERENCES `peptides`, PRIMARY KEY (`cluster_id`, `peptide_sequence`));
CREATE TABLE `peptides_sequencing_datasets` (`dataset_name` varchar(255) REFERENCES `sequencing_datasets` ON DELETE CASCADE, `peptide_sequence` varchar(255) REFERENCES `peptides`, `rank` integer, `reads` integer, `dominance` double precision, `result_id` integer REFERENCES `results` ON DELETE SET NULL, PRIMARY KEY (`dataset_name`, `peptide_sequence`));
CREATE TABLE `dna_sequences_peptides_sequencing_datasets` (`dna_sequence` varchar(255) REFERENCES `dna_sequences`, `peptide_sequence` varchar(255) REFERENCES `peptides`, `dataset_name` varchar(255) REFERENCES `sequencing_datasets` ON DELETE CASCADE, `reads` integer, PRIMARY KEY (`dna_sequence`, `peptide_sequence`, `dataset_name`));
CREATE TABLE `motifs` (`motif_sequence` varchar(255) NOT NULL PRIMARY KEY);
CREATE TABLE `motif_lists` (`list_name` varchar(255) NOT NULL PRIMARY KEY);
CREATE TABLE `motifs_motif_lists` (`list_name` integer REFERENCES `motif_lists` ON DELETE CASCADE, `motif_sequence` varchar(255) REFERENCES `motifs`, `target` varchar(255), `receptor` varchar(255), `source` varchar(255), PRIMARY KEY (`list_name`, `motif_sequence`));
CREATE TABLE `libraries_sequel_users` (`library_name` varchar(255) REFERENCES `libraries` ON DELETE CASCADE, `id` integer REFERENCES `sequel_users` ON DELETE CASCADE, PRIMARY KEY (`id`, `library_name`));
CREATE TABLE `selections_sequel_users` (`selection_name` varchar(255) REFERENCES `selections` ON DELETE CASCADE, `id` integer REFERENCES `sequel_users` ON DELETE CASCADE, PRIMARY KEY (`id`, `selection_name`));
CREATE TABLE `sequel_users_sequencing_datasets` (`dataset_name` varchar(255) REFERENCES `sequencing_datasets` ON DELETE CASCADE, `id` integer REFERENCES `sequel_users` ON DELETE CASCADE, PRIMARY KEY (`id`, `dataset_name`));
CREATE TABLE `sequel_users` (`id` integer NOT NULL PRIMARY KEY AUTOINCREMENT, `username` varchar(255) UNIQUE, `hashed_password` varchar(255), `salt` varchar(255), `created_at` timestamp, `permission_level` integer DEFAULT (1), `auto_selections` integer DEFAULT (0));
CREATE TABLE `peptide_performances` (`library_name` varchar(255) REFERENCES `libraries` ON DELETE CASCADE, `peptide_sequence` varchar(255) REFERENCES `peptides`, `performance` Text, PRIMARY KEY (`peptide_sequence`, `library_name`));
DELETE FROM sqlite_sequence;
CREATE INDEX `libraries_library_name_index` ON `libraries` (`library_name`);
CREATE INDEX `selections_selection_name_index` ON `selections` (`selection_name`);
CREATE INDEX `sequencing_datasets_dataset_name_index` ON `sequencing_datasets` (`dataset_name`);
CREATE INDEX `peptides_peptide_sequence_index` ON `peptides` (`peptide_sequence`);
CREATE INDEX `clusters_cluster_id_index` ON `clusters` (`cluster_id`);
CREATE INDEX `dna_sequences_dna_sequence_index` ON `dna_sequences` (`dna_sequence`);
CREATE INDEX `results_result_id_index` ON `results` (`result_id`);
CREATE INDEX `targets_target_id_index` ON `targets` (`target_id`);
CREATE INDEX `clusters_peptides_cluster_id_peptide_sequence_index` ON `clusters_peptides` (`cluster_id`, `peptide_sequence`);
CREATE INDEX `peptides_sequencing_datasets_dataset_name_peptide_sequence_index` ON `peptides_sequencing_datasets` (`dataset_name`, `peptide_sequence`);
CREATE INDEX `dna_sequences_peptides_sequencing_datasets_dna_sequence_peptide_sequence_dataset_name_index` ON `dna_sequences_peptides_sequencing_datasets` (`dna_sequence`, `peptide_sequence`, `dataset_name`);
CREATE INDEX `motifs_motif_sequence_index` ON `motifs` (`motif_sequence`);
CREATE INDEX `motif_lists_list_name_index` ON `motif_lists` (`list_name`);
CREATE INDEX `motifs_motif_lists_list_name_motif_sequence_index` ON `motifs_motif_lists` (`list_name`, `motif_sequence`);
CREATE INDEX `libraries_sequel_users_id_library_name_index` ON `libraries_sequel_users` (`id`, `library_name`);
CREATE INDEX `selections_sequel_users_id_selection_name_index` ON `selections_sequel_users` (`id`, `selection_name`);
CREATE INDEX `sequel_users_sequencing_datasets_id_dataset_name_index` ON `sequel_users_sequencing_datasets` (`id`, `dataset_name`);
CREATE INDEX `peptide_performances_library_name_peptide_sequence_index` ON `peptide_performances` (`library_name`, `peptide_sequence`);
COMMIT;
